if mibBuilder.loadTexts: h3cDot11STATION.setDescription("This MIB defines the configuration and statistic information of stations. GLOSSARY IEEE 802.11 Standard to encourage interoperability among wireless networking equipment. Access point (AP) Transmitter/receiver (transceiver) device that commonly connects and transports data between a wireless network and a wired network. Access control (AC) To control and manage multi-APs, it will bridge wireless and wired network. Control And Provisioning of Wireless Access Points Protocol The short name of protocol is CAPWAP. AC will control and manage AP by CAPWAP tunnel protocol defined by IETF. Also, a data tunnel will be set up between AC and AP. BSS IEEE 802.11 Basic Service Set (Radio Cell). The BSS of an AP comprises of the stations directly associated with the AP. station (Client Station) A wireless device in a wireless network associated with an access point. MIC Message Integrity Check. A MIC can, optionally, be added to WEP-encrypted 802.11 frames. SSID Radio Service Set ID. It is used for identification during association. STA (WSTA) A non-AP 802.11 wireless station. WEP Wired Equivalent Privacy. 'WEP' is generally used to refer to 802.11 encryption. RSSI It is the received signal strength indication. It suggests the quality of received signal. RTS Request to Send, it is used to gain control of the medium for the transmission of 'large' frames, in which 'large' is defined by the RTS threshold in the network card driver. CTS Clear to Send, it is used to answer RTS frames. AKM The authentication and key management method defined by 802.11i, and which includes 802.1x and pre-shared key.")
